# Library
import pandas as pd
import math
from random import Random
import random
from random import randint

"""![image.png](data:image/png;base64,)"""

# Membuat Individu

# lenght adalah jumlah kotak atau gen pada setiap individu
def individu(lenght,min,max):
  return [randint(min,max) for i in range(lenght)]

# Membuat populasi
# count adalah jumlah individu
def population(count,lenght,min,max):
  return [individu(lenght,min,max) for i in range(count)]

"""![image.png](data:image/png;base64,)"""

#Dekode Kromosom
def rumus(ra,rb,setengah_kromosom):
  g = 0
  sum = 0
  for i in range(len(setengah_kromosom)):
    sum += 9*(pow(10,-(i+1)))
    g += (setengah_kromosom[i]*(pow(10,-(i+1))))
  return rb+(((ra-rb)*g)/sum)


def decode(individu):
  # Keluaran dari fungsi adalah nilai x dan y
  return rumus(2,-1,individu[:len(individu)//2]),rumus(1,-1,individu[len(individu)//2:]) #batas ra dan rb pada x dan y mengikuti batas pada gambar dibawah

"""![image.png](data:image/png;base64,)"""

#Perhitungan fitness
def h(x,y):
  return ((math.cos(x**2))*(math.sin(y**2))) + (x+y)

def fit(kromosom):
  x,y = decode(kromosom)
  return h(x,y)

# https://www.youtube.com/watch?v=VBygj7p0HKc&ab_channel=RyanNoonan

# menghitung setiap fitness kromosom dan menyimpannya di dataframe
def createFitness(df):
  data_fitness = []
  for i in range(len(df)):
    data_fitness.append(fit(df['Kromosom'][i])) #menghitung setiap fitnes lalu menambahkan dengan sistem last ke list

  # membuat kolom baru dan memasukan nilai fitness
  df['fitness'] = data_fitness

  return df

"""![image.png](data:image/png;base64,)"""

# Pemilihan Orang Tua
def tournamentSelection(df):
  parent = []
  jumSelection = math.floor((2*len(df))/ 3) # 2/3 dari jumlah populasi

  for k in range(0,jumSelection):
    # angka untuk memilih random index kromosom yang akan di bandingkan
    angka_random = [randint(0,len(df)-1) for i in range(0,3)] 

    max = angka_random[0] # inisiasi

    # mencari index terbaik berdasarkan fitness
    for i in angka_random:
      if df['fitness'][max] < df['fitness'][i]:
        max = i
    parent.append(df['Kromosom'][max])
    
  return parent

# https://www.tutorialspoint.com/genetic_algorithms/genetic_algorithms_parent_selection.htm#:~:text=Parent%20Selection%20is%20the%20process,springs%20for%20the%20next%20generation.&text=This%20taking%20up%20of%20the,undesirable%20condition%20in%20a%20GA.

# mengambil data kromosom 1/10 terbaik
def getElitsm(df):
    # mensort data df di list biasa berdasarkan fitness
    temp = []
    for i in range(len(df['Kromosom'])):
      temp.append([df['fitness'][i],df['Kromosom'][i]])
    temp.sort(reverse = True)
    
    # return 1/5 teratas kromosom terbaik
    elitsm = []
    fitnessTerbaik = []
    jumElitsm = (math.floor(len(temp)/ 10))
    for i in range(jumElitsm):
      elitsm.append(temp[i][1]) # hanya menyimpan kromosom tidak dengan fitness
      fitnessTerbaik.append(temp[i][0])
    return elitsm,fitnessTerbaik #return list kromosom elitsm dan list nilai fitness terbaik

"""![image.png](data:image/png;base64,)"""

def singlePointCrossover(list_elitsme, TournamentSelection,Pc,jumChromosome,jumPopulasi):
  # point = math.floor(jumChromosome/ 3) #index point pada kromosom
  point = randint(12,jumChromosome-8) #index point pada kromosom
  # inisiasi awal elitsm akan termasuk ke dalam child
  child = []
  # proses perkawinan orang tua/kromosom yang akan menghasilkan child jumPopulasi - len(list_elitsme)
  while len(child) <= (jumPopulasi - len(list_elitsme)):
    # inisiasi variabel
    angkaRandomElitsm = randint(0,len(list_elitsme)-1)
    angkaRandomElitsm2 = randint(0,len(list_elitsme)-1)
    angkaRandomTournamentSelection = randint(0,len(TournamentSelection)-1)
    angkaRandomTournamentSelection2 = randint(0,len(TournamentSelection)-1)
    angkaRandom = random.uniform(0.0,1.0)

    # untuk mengecek bahwa Pc terpenuhi dari angkaRandom dan kromosoomnya tidak sama
    if (angkaRandom <= Pc) :
      angka_random_pemilihan_cara_crossOver = randint(0,2)
      # melakukan Single Point Crossover
      if (angka_random_pemilihan_cara_crossOver == 0) and (list_elitsme[angkaRandomElitsm] != TournamentSelection[angkaRandomTournamentSelection]): # kromosom yang di crossover yaitu angkaRandomTournamentSelection dengan angkaRandomTournamentSelection
        child1 = list_elitsme[angkaRandomElitsm][:point] + TournamentSelection[angkaRandomTournamentSelection][point:] #kromosom dari TournamentSelection menjadi ekor
        child2 = TournamentSelection[angkaRandomTournamentSelection][:point] + list_elitsme[angkaRandomElitsm][point:] #kromosom dari TournamentSelection menjadi kepala
        # agar tidak ada yang samaantara child yang telah ada dengan child hasil crossover
        if child1 not in child:
          child.append(child1)
        if child2 not in child:
          child.append(child2)

      elif (angka_random_pemilihan_cara_crossOver == 1) and (TournamentSelection[angkaRandomTournamentSelection2] != TournamentSelection[angkaRandomTournamentSelection]) : # kromosom yang di crossover yaitu elitsm dengan angkaRandomTournamentSelection
        child1 = TournamentSelection[angkaRandomTournamentSelection2][point:] + TournamentSelection[angkaRandomTournamentSelection][point:] #kromosom dari TournamentSelection menjadi ekor
        child2 =  TournamentSelection[angkaRandomTournamentSelection][:point] + TournamentSelection[angkaRandomTournamentSelection2][:point] #kromosom dari TournamentSelection menjadi kepala
        # agar tidak ada yang samaantara child yang telah ada dengan child hasil crossover
        if child1 not in child:
          child.append(child1)
        if child2 not in child:
          child.append(child2)

      elif (angka_random_pemilihan_cara_crossOver == 2) and (list_elitsme[angkaRandomElitsm] != list_elitsme[angkaRandomElitsm2]) : # kromosom yang di crossover yaitu elitsm dengan elitsm
        child1 = list_elitsme[angkaRandomElitsm2][:point] + list_elitsme[angkaRandomElitsm][point:] #kromosom dari angkaRandomElitsm menjadi ekor
        child2 = list_elitsme[angkaRandomElitsm][:point] + list_elitsme[angkaRandomElitsm2][point:] #kromosom dari angkaRandomElitsm menjadi kepala
        # agar tidak ada yang samaantara child yang telah ada dengan child hasil crossover
        if child1 not in child:
          child.append(child1)
        if child2 not in child:
          child.append(child2)
      # print('if')
      
      # print(len(child))
  return child[:jumPopulasi - len(list_elitsme)] #mengembalikan child dengan jumlah jumPopulasi - banyak elitsm

"""![image.png](data:image/png;base64,)"""

# Mutasi
def randomMutation(Pm,min,max,jumKromosom,childList):
  # setiap kromosom akan di perhitungkan terjadi mutasi
  for i in range(len(childList)):
    angkaRandom = random.uniform(0.0,1.0)
    if angkaRandom <= Pm :
      # generate angka random
      angkaRandomValue = random.randint(min,max)
      # mencari angkaRandomValue yang berbeda dengan isi index ke 3 yang akan diganti jika sama 
      while childList[i][3] == angkaRandomValue :
        angkaRandomValue = randint(min,max)
      childList[i][3] = angkaRandomValue
  return childList

# Pergantian Generasi
def steadyStateModel(elitsm,child):
  return elitsm + child

